import "./ProductItem.css";

let ProductItem = function ({product}) {
    return (
        <product-item>
            <img src={product.image}></img>
            
                <h1>{product.title}</h1>
                <item-price>
                    <h3>{product.price}</h3>    
                </item-price>
        </product-item>
    )
};

<item-price></item-price>
export default ProductItem;
